import{_ as c,a as e,b as t,c as i,d as h,e as o,f as r,g as l,h as m,i as d,j as g,k as s,l as p,m as n,n as u,o as f,p as b,q as _,r as v,s as w,t as k,u as q,v as x,w as P,x as y,y as F,z as T,A as S,B as I,C as R}from"./chunks/logged_messages.rgd6ee1p.js";import{_ as D,c as L,a8 as G,o as O}from"./chunks/framework.BDnHobkS.js";const B=JSON.parse('{"title":"Аналіз журналів за допомогою Flight Review","description":"","frontmatter":{},"headers":[],"relativePath":"uk/log/flight_review.md","filePath":"uk/log/flight_review.md"}'),A={name:"uk/log/flight_review.md"};function V(J,a,N,E,z,Q){return O(),L("div",null,a[0]||(a[0]=[G('<h1 id="аналіз-журналів-за-допомогою-flight-review" tabindex="-1">Аналіз журналів за допомогою Flight Review <a class="header-anchor" href="#аналіз-журналів-за-допомогою-flight-review" aria-label="Permalink to &quot;Аналіз журналів за допомогою Flight Review&quot;">​</a></h1><p>The <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a> plots for a flight can be used to analyze general vehicle condition.</p><p>Сюжети мають бути зрозумілими самі по собі, але для того, щоб знати, які діапазони є прийнятними і як повинен виглядати сюжет, потрібен деякий досвід. Ця сторінка пояснює, як інтерпретувати графіки та визначити загальні проблеми.</p><h2 id="загальне-використання" tabindex="-1">Загальне використання <a class="header-anchor" href="#загальне-використання" aria-label="Permalink to &quot;Загальне використання&quot;">​</a></h2><p>Особливості, які є загальними для багатьох сюжетів:</p><ul><li>Plot background color is used to indicate flight mode during recording (where graphs depend on mode): <img src="'+c+'" alt="Flight Modes"><ul><li><strong>Flight mode:</strong> Background colour on the body of the plot indicates flight mode. Наведення курсору миші на діаграму показує мітки режиму польоту.</li><li><strong>VTOL flight mode:</strong> VTOL vehicles additionally show the VTOL mode as background colour in the bottom part of the plot (blue for multicopter, yellow for fixed-wing, and red for transition).</li></ul></li><li>Прокручування мишею на певній вісі графіка зумовлює збільшення цієї вісі (горизонтально або вертикально).</li><li>Прокручування миші всередині графіка збільшує обидва вісі.</li></ul><p><a id="tracking"></a></p><h2 id="виконання-відстеження-pid" tabindex="-1">Виконання відстеження PID <a class="header-anchor" href="#виконання-відстеження-pid" aria-label="Permalink to &quot;Виконання відстеження PID&quot;">​</a></h2><p>Залежно від режиму польоту, контролери транспортного засобу можуть намагатися відстежувати установочні точки положення, швидкості, висоти або швидкості (відстежувані установочні точки залежать від режиму, наприклад: в режимі стабілізації немає установочної точки швидкості).</p><p>The <strong>Estimated</strong> line (red) should closely match with the <strong>Setpoint</strong> (green). Якщо вони цього не роблять, у більшості випадків потрібно налаштувати коефіцієнти ПІД цього контролера.</p><p>The <a href="./../config_mc/pid_tuning_guide_multicopter.html">Multicopter PID Tuning Guide</a> contains example plots and information about analysing tracking performance.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>For the rate controller in particular, it is useful to enable the high-rate logging profile (<a href="./../advanced_config/parameter_reference.html#SDLOG_PROFILE">SDLOG_PROFILE</a>) to get more details when zooming in.</p></div><h2 id="вібрація" tabindex="-1">Вібрація <a class="header-anchor" href="#вібрація" aria-label="Permalink to &quot;Вібрація&quot;">​</a></h2><p>Вібрація є однією з найпоширеніших проблем для багатороторних транспортних засобів. Високі рівні вібрації можуть призвести до:</p><ul><li>менш ефективний польот і скорочений час польоту</li><li>двигуни можуть нагрітися</li><li>збільшене зношування матеріалу</li><li>неможливість налаштувати транспортний засіб тісно, що призводить до погіршення польотних характеристик.</li><li>обрізання сенсора</li><li>оцінка позиції провалилася, що потенційно призводить до збоїв.</li></ul><p>Тому важливо слідкувати за рівнем вібрації та вдосконалювати налаштування у разі необхідності.</p><p>Є точка, де рівень вібрації однозначно занадто високий, і, як правило, нижчі рівні вібрації краще. Однак є широкий діапазон між &#39;все в порядку&#39; та &#39;рівні занадто високі&#39;. Цей діапазон залежить від кількох факторів, включаючи розмір транспортного засобу - оскільки більші транспортні засоби мають вищу інерцію, що дозволяє більше програмного фільтрування (у той ж час вібрації на більших транспортних засобах мають меншу частоту).</p><p>Наступні абзаци та розділи надають інформацію про те, які графіки використовувати для перевірки рівнів вібрації, та як їх аналізувати.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>It is worth looking at multiple charts when analyzing vibration (different charts can better highlight some issues).</p></div><h3 id="керування-приводами-fft" tabindex="-1">Керування приводами FFT <a class="header-anchor" href="#керування-приводами-fft" aria-label="Permalink to &quot;Керування приводами FFT&quot;">​</a></h3><div class="info custom-block"><p class="custom-block-title">INFO</p><p>You need to enable the high-rate logging profile (<a href="./../advanced_config/parameter_reference.html#SDLOG_PROFILE">SDLOG_PROFILE</a>) to see this plot.</p></div><p>Цей графік показує частотний графік для відвалу, крена та осі курсу на основі сигналу керування приводами (вихід PID від контролера швидкості). Це допомагає визначити частотні піки та налаштувати програмні фільтри. Повинен бути лише один пік на найнижчому кінці (нижче близько 20 Гц), решта повинна бути низькою та плоскою.</p><p>Зверніть увагу, що масштабування по осі Y відрізняється для різних транспортних засобів, але журнали з одного й того ж транспортного засобу можуть бути безпосередньо порівняні між собою.</p><h4 id="приклади-хороша-вібрація" tabindex="-1">Приклади: Хороша вібрація <a class="header-anchor" href="#приклади-хороша-вібрація" aria-label="Permalink to &quot;Приклади: Хороша вібрація&quot;">​</a></h4><p><a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">QAV-R 5&quot; Racer</a> frame (excellent vibration).</p><p><img src="'+e+'" alt="Low vibration QAV-R 5 Racer - FFT plot"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The excellent vibration characteristics of the above frame mean that we can considerably increase the cutoff frequency of the <a href="./../config_mc/filter_tuning.html">software filters</a> (reducing control latency).</p></div><p>Каркас DJI F450 (добре вібрує).</p><p><img src="'+t+'" alt="Low vibration DJI F450 - FFT plot"></p><p>Каркас S500:</p><p><img src="'+i+'" alt="Low vibration S500 actuator controls - FFT plot"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>While the plot above looks good, the <a href="#raw_acc_s500">Raw Acceleration graph for the same flight</a> shows that the vibration levels are a bit high for x and y. Це хороший приклад того, чому варто перевіряти кілька графіків!</p></div><h4 id="приклади-погана-вібрація" tabindex="-1">Приклади: Погана вібрація <a class="header-anchor" href="#приклади-погана-вібрація" aria-label="Permalink to &quot;Приклади: Погана вібрація&quot;">​</a></h4><p>Цей приклад показує пік частоти близько 50 Гц (у цьому випадку через &quot;вільне&quot; шасі).</p><p><img src="'+h+'" alt="Vibrations in landing gear - FFT plot"></p><h3 id="спектральна-густина-потужності-прискорення" tabindex="-1">Спектральна густина потужності прискорення <a class="header-anchor" href="#спектральна-густина-потужності-прискорення" aria-label="Permalink to &quot;Спектральна густина потужності прискорення&quot;">​</a></h3><p>Це двовимірний графік частот, що показує частотну відповідь сирих даних акселерометра з часом (він відображає суму для вісей x, y та z). Чим більше жовтий ділянка, тим вище частотна відповідь в цей час і частоту.</p><p>Ідеально лише найнижча частина до кількох Гц є жовтою, а решта в основному зелена або синя.</p><h4 id="приклади-хороша-вібрація-1" tabindex="-1">Приклади: Хороша вібрація <a class="header-anchor" href="#приклади-хороша-вібрація-1" aria-label="Permalink to &quot;Приклади: Хороша вібрація&quot;">​</a></h4><p><a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">QAV-R 5&quot; Racer</a> frame (excellent vibration).</p><p><img src="'+o+'" alt="Low vibration QAV-R 5 Racer - spectral density plot"></p><p>Каркас DJI F450 (добре вібрує). <img src="'+r+'" alt="Low vibration DJI F450 - spectral density plot"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Above you can see the blade passing frequency of the propellers at around 100 Hz.</p></div><p>S500 frame: <img src="'+l+'" alt="Vibration S500 - spectral density plot"></p><h4 id="приклади-погана-вібрація-1" tabindex="-1">Приклади: Погана вібрація <a class="header-anchor" href="#приклади-погана-вібрація-1" aria-label="Permalink to &quot;Приклади: Погана вібрація&quot;">​</a></h4><p>Міцні жовті лінії приблизно на 100 Гц вказують на можливу проблему, яка вимагає подальшого вивчення (починаючи з перегляду інших діаграм).</p><p><img src="'+m+'" alt="High vibration in spectral density plot"></p><p>Цей графік нижче показує пік частоти близько 50 Гц (у цьому випадку через &quot;вільне&quot; шасі).</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>This indicates a possible problem because it is a strong single low frequency that is close to the vehicle dynamics. Зі стандартними налаштуваннями фільтрації на частоті 80 Гц вібрації на частоті 50 Гц не будуть фільтруватися.</p></div><p><img src="'+d+'" alt="Vibrations in landing gear - spectral density plot"></p><p>Дуже висока (небезпечна) вібрація! Зверніть увагу, що графік майже повністю жовтий.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>You should not fly with such high vibration levels.</p></div><p><img src="'+g+'" alt="Exceedingly high vibration in spectral density plot"></p><h3 id="прискорення-без-обробки" tabindex="-1">Прискорення без обробки <a class="header-anchor" href="#прискорення-без-обробки" aria-label="Permalink to &quot;Прискорення без обробки&quot;">​</a></h3><p>Цей графік показує сирі вимірювання акселерометра для вісей x, y та z. Ідеально, якщо кожна лінія тонка і чітко показує прискорення транспортного засобу.</p><p>Зазвичай, якщо графік по осі z торкається графіка по осях x/y під час наведення або повільного польоту, рівні вібрації є занадто високими.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The best way to use this graph is to zoom in a bit to a part where the vehicle is hovering.</p></div><h4 id="приклади-хороша-вібрація-2" tabindex="-1">Приклади: Хороша вібрація <a class="header-anchor" href="#приклади-хороша-вібрація-2" aria-label="Permalink to &quot;Приклади: Хороша вібрація&quot;">​</a></h4><p><a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">QAV-R 5&quot; Racer</a> frame (excellent vibration).</p><p><img src="'+s+'" alt="Low vibration QAV-R 5 Racer - raw accel. plot"></p><p>Каркас DJI F450 (добре вібрує). <img src="'+p+'" alt="Low vibration DJI F450 - raw accel. plot"></p><h4 id="приклади-погана-вібрація-2" tabindex="-1">Приклади: Погана вібрація <a class="header-anchor" href="#приклади-погана-вібрація-2" aria-label="Permalink to &quot;Приклади: Погана вібрація&quot;">​</a></h4><p><a id="raw_acc_s500"></a> S500 frame. Рівні вібрації на межі - трохи високі для x та y (що є типовим для конструкції S500). Це на межі, де це починає негативно впливати на польотові характеристики.</p><p><img src="'+n+'" alt="Borderline vibration S500 x, y - raw accel. plot"></p><p>Вібрація занадто висока. Зверніть увагу, як графік вісі z накладається на графік вісі x/y:</p><p><img src="'+u+'" alt="Vibrations in landing gear - raw accel. plot"></p><p>Рівні вібрації занадто високі. Зверніть увагу, як графік вісі z накладається на графік вісі x/y:</p><p><img src="'+f+'" alt="High vibration in raw accel. plot"></p><p>Дуже високі (небезпечні) рівні вібрації.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>You should not fly with such high vibration levels.</p></div><p><img src="'+b+'" alt="Exceedingly high vibration in raw accel. plot"></p><p><a id="fifo_logging"></a></p><h3 id="графіки-даних-високошвидкісних-іму" tabindex="-1">Графіки даних високошвидкісних ІМУ <a class="header-anchor" href="#графіки-даних-високошвидкісних-іму" aria-label="Permalink to &quot;Графіки даних високошвидкісних ІМУ&quot;">​</a></h3><p>Для детального аналізу є можливість реєструвати сирові дані ІМП на повну швидкість (кілька кГц, в залежності від ІМП). Це дозволяє інспекцію набагато вищих частот, ніж при звичайному веденні журналування, що може допомогти при виборі віброізоляторів або налаштуванні нижніх та полосних фільтрів належним чином.</p><p>Щоб використовувати його, деякі параметри потрібно змінити:</p><ul><li><p>Set <a href="./../advanced_config/parameter_reference.html#IMU_GYRO_RATEMAX">IMU_GYRO_RATEMAX</a> to 400. Це забезпечує те, що сирові дані датчика ефективніше упаковані при відсиланні з датчика до решти системи та зменшує розмір звітів (не зменшуючи корисних даних).</p></li><li><p>Використовуйте хороший SD-картку, оскільки дані ІМП потребують високої ширини смуги реєстрації (Огляд польотів покаже втрати, якщо швидкість реєстрації стане занадто великою).</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>See <a href="./../dev_log/logging.html#sd-cards">Logging &gt; SD Cards</a> for a comparison of popular SD card.</p></div></li></ul><p>:::</p><ul><li>Enable either the gyro or accel high-rate FIFO profile in <a href="./../advanced_config/parameter_reference.html#SDLOG_PROFILE">SDLOG_PROFILE</a> and disable the rest of the entries. Якщо ви використовуєте дійсно хорошу SD-карту (бачите кілька / немає викидів), ви можете: <ul><li>або увімкніть обидві профілі прискорення та гіроскопу</li><li>або увімкніть аксел/гіроскоп плюс профіль реєстрації за замовчуванням</li></ul></li></ul><p>Приклад графіка:</p><p><img src="'+_+'" alt="high-rate accel power spectral density"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Data of the first IMU is logged, which is not necessarily the same as the one used for flying. Це в основному важливо лише у випадках, коли ІХА встановлені по-різному (наприклад, жорстко кріплені проти м&#39;яко кріплених).</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Do not forget to restore the parameters after testing.</p></div><p><a id="solutions"></a></p><h3 id="виправлення-проблем-з-вібрацією" tabindex="-1">Виправлення проблем з вібрацією <a class="header-anchor" href="#виправлення-проблем-з-вібрацією" aria-label="Permalink to &quot;Виправлення проблем з вібрацією&quot;">​</a></h3><p>Дуже часто джерело вібрації (або поєднання декількох джерел) не може бути ідентифіковано тільки з журналів.</p><p>У цьому випадку транспортний засіб слід перевірити. <a href="./../assembly/vibration_isolation.html">Vibration Isolation</a> explains some basic things you can check (and do) to reduce vibration levels.</p><h2 id="виводи-приводу" tabindex="-1">Виводи приводу <a class="header-anchor" href="#виводи-приводу" aria-label="Permalink to &quot;Виводи приводу&quot;">​</a></h2><p>The <em>Actuator Outputs</em> graph shows the signals that are sent to the individual actuators (motors/servos). Загалом воно знаходиться в діапазоні між мінімальним і максимальним налаштованими значеннями ШІМ (наприклад, від 1000 до 2000).</p><p>This is an example for a quadrotor where everything is OK (all of the signals are within the range, approximately overlap each other, and are not too noisy): <img src="'+v+'" alt="Good actuator outputs"></p><p>Сюжет може допомогти виявити різні проблеми:</p><ul><li><p>If one or more of the signals is at the maximum over a longer time, it means the controller runs into <strong>saturation</strong>. Не обов&#39;язково, що це проблема, наприклад, коли літаєте на повному газі, це очікується. Але якщо це стається, наприклад, під час місії, це ознака того, що транспортний засіб перевищує вагою кількість тяги, яку він може забезпечити.</p></li><li><p>For a multicopter the plot can be a good indication if the vehicle is <strong>imbalanced</strong>. Показано на графіку, що один або більше сусідніх двигунів (два у випадку квадрокоптера) мають працювати з вищим потужностю в середньому. Зверніть увагу, що це також може бути справа, якщо деякі двигуни надають більше тяги, ніж інші, або РПТ не відкалібровані. Дисбалансний транспортний засіб, як правило, не є великою проблемою, оскільки автопілот автоматично врахує це. Однак це зменшує максимальний досяжний тягун і навантажує деякі двигуни більше, тому краще збалансувати літальний апарат.</p></li><li><p>Дисбаланс також може виникнути від осі рискання. Сюжет буде схожий з попереднім випадком, але протилежні двигуни будуть працювати вище або нижче відповідно. Причина ймовірно у тому, що один або кілька моторів нахилений.</p><p>This is an example from a hexarotor: motors 1, 3 and 6 run at higher thrust: <img src="'+w+'" alt="Hexrotor imbalanced actuator outputs"></p></li><li><p>If the signals look very <strong>noisy</strong> (with high amplitudes), it can have two causes: sensor noise or vibrations passing through the controller (this shows up in other plots as well, see previous section) or too high PID gains. This is an extreme example: <img src="'+k+'" alt="Noisy actuator outputs - extreme case"></p></li></ul><h2 id="невизначеність-gps" tabindex="-1">Невизначеність GPS <a class="header-anchor" href="#невизначеність-gps" aria-label="Permalink to &quot;Невизначеність GPS&quot;">​</a></h2><p>The <em>GPS Uncertainty</em> plot shows information from the GPS device:</p><ul><li>Кількість використаних супутників (повинна бути близько 12 або вище)</li><li>Точність горизонтального положення (має бути менше 1 метра)</li><li>Точність вертикального положення (має бути менше 2 метрів)</li><li>GPS фіксація: це 3 для 3D GPS фіксації, 4 для GPS + Dead Reckoning, 5 для RTK float та 6 для RTK фіксованого типу</li></ul><h2 id="gps-noise-jamming" tabindex="-1">GPS Noise &amp; Jamming <a class="header-anchor" href="#gps-noise-jamming" aria-label="Permalink to &quot;GPS Noise &amp; Jamming&quot;">​</a></h2><p>The GPS Noise &amp; Jamming plot is useful to check for GPS signal interferences and jamming. Сигнал GPS дуже слабкий і, отже, його легко можна порушити / перешкодити компонентами, що передають (через кабель) або випромінюють на частоті, яку використовує GPS.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>USB 3 is <a href="https://www.usb.org/sites/default/files/327216.pdf" target="_blank" rel="noreferrer">known to be</a> an effective GPS jamming source.</p></div><p>The <strong>jamming indicator</strong> should be around or below 40. Значення навколо 80 або вище є занадто високими, і налаштування повинні бути перевірені. Перешкоди сигналу також помітні як зменшення точності та менша кількість супутників до того моменту, коли неможливо отримати фіксацію GPS.</p><p>Це приклад без будь-якого втручання:</p><p><img src="'+q+'" alt="GPS jamming - good plot"></p><h2 id="тяга-та-магнітне-поле" tabindex="-1">Тяга та магнітне поле <a class="header-anchor" href="#тяга-та-магнітне-поле" aria-label="Permalink to &quot;Тяга та магнітне поле&quot;">​</a></h2><p>The <em>Thrust and Magnetic Field</em> plot shows the thrust and the norm of the magnetic sensor measurement vector.</p><p>Норма повинна бути постійною протягом усього польоту і не пов&#39;язана з тягою. This is a good example where the norm is very close to constant: <img src="'+x+'" alt="Thrust and mag close to constant"></p><p><em>If it is correlated</em>, it means that the current drawn by the motors (or other consumers) is influencing the magnetic field. Це слід уникати, оскільки це призводить до невірної оцінки кута розвороту. The following plot shows a strong correlation between the thrust and the norm of the magnetometer: <img src="'+P+'" alt="Correlated thrust and mag"></p><p>Рішення для цього є:</p><ul><li>Використовуйте зовнішній магнітомер (уникайте використання внутрішнього магнітомера)</li><li>Якщо використовується зовнішній магнітометр, перемістіть його подалі від сильних течій (тобто за допомогою (довшої) GPS-стійки).</li></ul><p>Якщо норма не корелює, але не постійна, найімовірніше вона не відкалібрована належним чином. Проте це також може бути пов&#39;язано з зовнішніми перешкодами (наприклад, коли літаєте близько до металевих конструкцій).</p><p>This example shows that the norm is non-constant, but it does not correlate with the thrust: <img src="'+y+'" alt="Uncorrelated thrust and mag"></p><h2 id="сторожовии-оцінювач" tabindex="-1">Сторожовий оцінювач <a class="header-anchor" href="#сторожовии-оцінювач" aria-label="Permalink to &quot;Сторожовий оцінювач&quot;">​</a></h2><p>The <em>Estimator Watchdog</em> plot shows the health report of the estimator. Воно має бути постійним нулем.</p><p>This is what it should look like if there are no problems: <img src="'+F+'" alt="Estimator watchdog - good"></p><p>Якщо один з прапорців не є нульовим, оцінювач виявив проблему, яку потрібно додатково вивчити. У більшості випадків це проблема з сенсором, наприклад, перешкоди магнітомера. Зазвичай це допомагає глянути на графіки відповідного сенсора.</p><p>Here is an example with magnetometer problems: <img src="'+T+'" alt="Estimator watchdog with magnetometer problems"></p><h2 id="регулярність-вибірки-даних-сенсора" tabindex="-1">Регулярність вибірки даних сенсора <a class="header-anchor" href="#регулярність-вибірки-даних-сенсора" aria-label="Permalink to &quot;Регулярність вибірки даних сенсора&quot;">​</a></h2><p>Графік регулярного вибіркового відтворення надає уявлення про проблеми з системою ведення журналу та плануванням.</p><p>The amount of <strong>logging dropouts</strong> start to increase if the log buffer is too small, the logging rate is too high or a low-quality SD card is used.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Occasional dropouts can be expected on medium quality cards.</p></div><p>The <strong>delta t</strong> shows the time difference between two logged IMU samples. Це повинно бути близько до 4 мс, оскільки швидкість публікації даних становить 250 Гц. Якщо є піки, які є кратними цьому (і затримка часу оцінювача не збільшується), це означає, що журналізатор пропустив деякі зразки. Іноді це може трапитися через те, що реєстратор працює з нижчою пріоритетністю. Якщо є шипи, які не є кратними, це вказує на неправильне планування драйвера датчика, яке потрібно дослідити.</p><p>The <strong>estimator timeslip</strong> shows the difference between the current time and the time of the integrated sensor intervals up to that time. Якщо це змінюється, це означає, що або оцінювач пропустив дані датчика, або водій публікує невірні інтервали інтеграції. Воно повинно залишатися на нулі, але може трохи збільшуватися при змінах параметрів в польоті, що, як правило, не є проблемою.</p><p>This is a good example: <img src="'+S+'" alt="Sampling regularity good"></p><p>The following example contains too many dropouts, the quality of the used SD card was too low in that case (see <a href="./../dev_log/logging.html#sd-cards">here</a> for good SD cards):</p><p><img src="'+I+'" alt="Many Dropouts"></p><h2 id="зареєстровані-повідомлення" tabindex="-1">Зареєстровані повідомлення <a class="header-anchor" href="#зареєстровані-повідомлення" aria-label="Permalink to &quot;Зареєстровані повідомлення&quot;">​</a></h2><p>Це таблиця з повідомленнями про системні помилки та попередження. Наприклад, вони показують, коли завдання стає низьким за об&#39;ємом стеку.</p><p>Повідомлення потрібно розглядати індивідуально, і не всі з них вказують на проблему. For example the following shows a kill-switch test: <img src="'+R+'" alt="Logged Messages"></p><h2 id="приклади-огляду-журналу-польотів-кадру" tabindex="-1">Приклади огляду журналу польотів / кадру <a class="header-anchor" href="#приклади-огляду-журналу-польотів-кадру" aria-label="Permalink to &quot;Приклади огляду журналу польотів / кадру&quot;">​</a></h2><p>Часто варто розглянути кілька графіків для певного польоту при аналізі стану транспортного засобу (різні графіки можуть краще підкреслити деякі проблеми). Це особливо важливо при перегляді можливих проблем з вібрацією.</p><p>Розділ нижче групує кілька (раніше презентованих) графіків за рейс/транспортний засіб.</p><h3 id="qav-r-5-racer" tabindex="-1">QAV-R 5&quot; Racer <a class="header-anchor" href="#qav-r-5-racer" aria-label="Permalink to &quot;QAV-R 5&quot; Racer&quot;">​</a></h3><p>These charts are all from the same flight of a <a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">QAV-R 5&quot; Racer</a>.</p><p>Вони показують транспортний засіб, який має дуже низькі вібрації:</p><ul><li>Контролер приводу FFT показує лише один пік в найнижчій частині, а решта низька та плоска.</li><li>Спектральна щільність в основному зелена, лише трохи жовта на низьких частотах.</li><li>Прискорення в сирому вигляді має слід по осі z, чітко відокремлений від слідів по осі x/y.</li></ul><p><img src="'+e+'" alt="Low vibration QAV-R 5 Racer - FFT plot"></p><p><img src="'+o+'" alt="Low vibration QAV-R 5 Racer - spectral density plot"></p><p><img src="'+s+'" alt="Low vibration QAV-R 5 Racer - raw accel. plot"></p><h3 id="dji-f450" tabindex="-1">DJI F450 <a class="header-anchor" href="#dji-f450" aria-label="Permalink to &quot;DJI F450&quot;">​</a></h3><p>These charts are all from the same flight of a <em>DJI F450</em>.</p><p>Вони показують автомобіль, який має низьку вібрацію (але не таку низьку, як у QAV-R вище!):</p><ul><li>Контрольні Фурнкції FFT показують пік в найнижчій точці. Більшість решти є плоскою, за винятком випинання на близько 100 Гц (це частота проходження лопастей гвинтів).</li><li>Спектральна густина переважно зелена. Частота проходження леза знову видима.</li><li>Прискорення в сирому вигляді має слід по осі z, чітко відокремлений від слідів по осі x/y.</li></ul><p><img src="'+t+'" alt="Low vibration DJI F450 - FFT plot"></p><p><img src="'+r+'" alt="Low vibration DJI F450 - spectral density plot"></p><p><img src="'+p+'" alt="Low vibration DJI F450 - raw accel. plot"></p><h3 id="s500" tabindex="-1">S500 <a class="header-anchor" href="#s500" aria-label="Permalink to &quot;S500&quot;">​</a></h3><p>Ці діаграми усі з одного рейсу літака S500.</p><p>Вони показують транспортний засіб, який має майже прийнятні вібрації:</p><ul><li>Контрольні Фурнкції FFT показують пік в найнижчій точці. Більшість решти є плоскою, за винятком виступу близько 100 Гц.</li><li>Спектральна щільність в основному зелена, але жовта більше, ніж у DJI F450 на частоті 100 Гц.</li><li>Прискорення в сирому вигляді має слід зісипу в напрямку осі z, досить близький до слідів по осі x/y. Це на межі, де це починає негативно впливати на польотові характеристики.</li></ul><p><img src="'+i+'" alt="Low vibration S500 actuator controls - FFT plot"></p><p><img src="'+l+'" alt="Vibration S500 - spectral density plot"></p><p><img src="'+n+'" alt="Borderline vibration S500 x, y - raw accel. plot"></p>',149)]))}const U=D(A,[["render",V]]);export{B as __pageData,U as default};
